import React,{useContext} from 'react'
import { RoomContext } from '../context'
import {Link} from "react-router-dom"
import LoginNavBar from '../logincomponents/LoginNavBar'
import {FcHome} from "react-icons/fc"


//get all the unique values
const getUnique = (items,value) =>{
    return [...new Set(items.map(item => item[value]))]
}


const BookedProperties = ({rooms}) => {


        const context = useContext(RoomContext)
        // console.log(context);
        const{
            handleChange,
            type,
            capacity,
            price,
            minPrice,
            maxPrice,
            place,
            // breakfast,
            // pets
        } = context
    
    
        //get unique type values
        let types = getUnique(rooms,'type')
        let places=getUnique(rooms,'place');
    
        //add All
        types=['all',...types]
    
        //add Shima
        places=['None',...places]
    
        //map to JSX (type)
        types = types.map((item,index) =>{
            return <option value={item} key ={index}>{item}</option>
        })
    
        //map to JSX (Number of People)
        let people = getUnique(rooms,'capacity');
        people = people.map((item,index) =>{
            return <option value={item} key={index}>{item}</option>
        })
    
        //map to JSX (Place)    
        places = places.map((item,index)=>{
            return <option key={index} value={item}>{item}</option> 
        })

    return (
        <div>
            <LoginNavBar/>
            <br/>
            <br/>
            <br/>            
            <h1>Your Booked Properties:<FcHome size={40}/></h1>
            <Link to='/Login' className="btn-primary">Login</Link>
        </div>


    )
}

export default BookedProperties;
